# %%
class KEGG_KO_RN:
    ids: Dict[int, "KEGG_KO_RN"] = {}  # id: (ko0, ko1), (rn1, rn2)
    kos: Dict[str, Set[str]] = {}  # ko: {id1, id2}
    rns: Dict[str, Set[str]] = {}  # rn: {id1, id2}

    def __init__(self, id: int, kos: Set[str], rns: Set[str]):
        self.id = id
        self.kos = kos
        self.rns = rns
        self._update_cls()

    def _update_cls(self):
        type(self).ids[self.id] = self
        for ko in self.kos:
            type(self).kos.setdefault(ko, set()).add(self.id)
        for rn in self.rns:
            type(self).rns.setdefault(rn, set()).add(self.id)

    @classmethod
    def fromElement(cls, e: minidom.Element):
        if e.getAttribute("type") != "ortholog":
            raise Exception("wrong node")
        e_id: str = e.getAttribute("id")
        id = int(e_id)
        e_ko: str = e.getAttribute("name")
        kos = {ko[3:] for ko in e_ko.split()}
        e_rn: str = e.getAttribute("reaction")
        rns = {rn[3:] for rn in e_rn.split()}
        ko_rn = cls(id, kos, rns)

        return ko_rn

    @classmethod
    def ko2rn(cls, *kos):
        return {rn for ko in kos if ko in cls.kos for id in cls.kos[ko] for rn in cls.ids[id].rns}

    @classmethod
    def rn2ko(cls, *rns):
        return {ko for rn in rns if rn in cls.rns for id in cls.rns[rn] for ko in cls.ids[id].kos}


# %%
class KEGG_RN:
    class Direction(Enum):
        reversible = "==>"
        irreversible = "<=>"

    ids: Dict[int, "KEGG_RN"] = {}  # id: (rn1, rn2), direction, substrates, products
    rns: Dict[str, Set[str]] = {}  # rn: {id1, id2}
    cpds: Dict[str, Set[str]] = {} # cpd: {rn1, rn2}
    formulas: Dict[Tuple[Direction, Tuple[str], Tuple[str]], int]= {}

    def __init__(self, id: int, rns: Set[str],
                 direction: Direction = Direction.reversible,
                 substrates: Set[str] = set(),
                 products: Set[str] = set()):
        self.id = id
        self.rns = rns
        self.direction = direction
        self.substrates = substrates
        self.products = products
        self._update_cls()

    def _update_cls(self):
        formula = self.direction, tuple(sorted(self.substrates)), tuple(sorted(self.products))
        if formula in type(self).formulas:
            return
        type(self).formulas[formula] = self.id
        type(self).ids[self.id] = self
        for rn in self.rns:
            type(self).rns.setdefault(rn, set()).add(self.id)
            for cpd in (*self.substrates, *self.products):
                type(self).cpds.setdefault(cpd, set()).add(rn)

    #def __repr__(self):
    #    return (self.id, self.rns, self.direction,
    #            self.products, self.products, self.substrates)

    def __str__(self):
        substrates = " + ".join(self.substrates)
        products = " + ".join(self.products)
        direction = '<=>' if self.direction == self.Direction.reversible else '==>'
        return f"{substrates} {direction} {products}"

    @classmethod
    def fromElement(cls, e: minidom.Element):
        if e.nodeName != "reaction":
            raise Exception("wrong node")
        e_id: str = e.getAttribute("id")
        id = int(e_id)
        e_rn: str = e.getAttribute("name")
        rns = {rn[3:] for rn in e_rn.split()}
        e_dr = e.getAttribute("type")
        direction = cls.Direction[e_dr]
        substrates = set()
        products = set()
        for child in e.childNodes:
            if child.nodeName == "substrate":
                substrates.add(child.getAttribute("name")[4:])
            elif child.nodeName == "product":
                products.add(child.getAttribute("name")[4:])
        rn = cls(id, rns, direction, substrates, products)

        return rn


