def KO2G(kos: Set[str]):
    kos = set(kos)
    rns = KEGG_KO_RN.ko2rn(*kos)
    ids = {id for rn in rns if rn in KEGG_RN.rns for id in KEGG_RN.rns[rn]}
    G = nx.Graph()
    for formula, id in KEGG_RN.formulas.items():
        if id not in ids:
            continue
        direction, substrates, products = formula
        kosi = KEGG_KO_RN.rn2ko(*KEGG_RN.ids[id].rns)
        if not kos & kosi:
            raise KeyError(f"reaction {rns} not found")
        G.add_node(f"{id}, substrate", label=" ", size=0, color="gray")
        G.add_node(f"{id}, product", label=" ", size=0, color="gray")
        G.add_edge(f"{id}, substrate", f"{id}, product", title=" ".join(kosi),
                   length=1, width=3,
                   rns=list(KEGG_RN.ids[id].rns), direction=str(direction))
        for cpd in substrates:
            G.add_node(cpd, label=COMPOUNDs.get(cpd, cpd), title=cpd, color="gray")
            G.add_edge(cpd, f"{id}, substrate", length=0.5, width=1)
        for cpd in products:
            G.add_node(cpd, label=COMPOUNDs.get(cpd, cpd), title=cpd, color="gray")
            G.add_edge(cpd, f"{id}, product", length=0.5, width=1)

    for subn in nx.cycle_basis(G):
        for e in nx.subgraph(G, subn).edges:
            G.edges[e]["color"] = "black"

    return G


def select_subn(G: nx.Graph, kos: Set[str] = None, rns: Set[str] = None, cpds: Set[str] = None):
    kos = kos or set()
    rns = rns or set()
    cpds = cpds or set()

    ids = {id for rn in (KEGG_KO_RN.ko2rn(*kos) | set(rns)) for id in KEGG_RN.rns[rn]}
    cpds = G.nodes & {cpd for id in ids for cpd in (*KEGG_RN.ids[id].substrates, *KEGG_RN.ids[id].products)}
    subn = set()
    while cpds:
        cpd = cpds.pop()
        subn.update(nx.node_connected_component(G, cpd))
        cpds -= subn
    return subn


