def report__cpd2ko(*focus_cpds):
    for cpd in focus_cpds:
        for RN in {KEGG_RN.ids[id] for rn in KEGG_RN.cpds[cpd]
                   for id in KEGG_RN.rns[rn]}:
            kos = ", ".join(KEGG_KO_RN.rn2ko(*RN.rns))
            substrates = " + ".join((COMPOUNDs.get(cpd, cpd) for cpd in RN.substrates))
            products = " + ".join((COMPOUNDs.get(cpd, cpd) for cpd in RN.products))
            print(f"{kos}: {substrates} {RN.direction.value} {products}")

